name: Mods
description: ''
endpoints:
  -
    httpMethods:
      - POST
    uri: mods
    metadata:
      title: 'Create Mod'
      description: 'Creates a new mod'
      authenticated: true
      custom: []
    headers:
      Content-Type: application/json
      Accept: application/json
    urlParameters: []
    queryParameters: []
    bodyParameters:
      name:
        name: name
        description: 'Must be at least 3 characters. Must not be greater than 150 characters.'
        required: false
        example: ryjlhiolxcftyjgssshznotzhumdbvdgffcshvgqjeujycjbveeszrynoyfcfpslsjhldkpjewlyhyutqpjlhdqelcqitrpysnyhm
        type: string
        custom: []
      desc:
        name: desc
        description: 'Must be at least 3 characters. Must not be greater than 30000 characters.'
        required: false
        example: 
        type: string
        custom: []
      license:
        name: license
        description: 'Must not be greater than 30000 characters.'
        required: false
        example: 
        type: string
        custom: []
      changelog:
        name: changelog
        description: 'Must not be greater than 30000 characters.'
        required: false
        example: 
        type: string
        custom: []
      short_desc:
        name: short_desc
        description: 'Must not be greater than 150 characters.'
        required: false
        example: cayidknhzbiodlnufnttjkvtfjvorgaqiiobxdzecnrnzxryqapcigxlyxhxupytzttniqgbkzlkdvyydxwkuoclilbodnhwsyqjwsbjvfmjiwwheqzgqyycimbrjgwgqemrzoxzcfuw
        type: string
        custom: []
      donation:
        name: donation
        description: 'Must not be greater than 100 characters.'
        required: false
        example: dgyvoffpzxfuiofouzphlhuxdxzhubyxkddaci
        type: string
        custom: []
      version:
        name: version
        description: 'Must not be greater than 100 characters.'
        required: false
        example: klotzpeokmwesuakkyslztgzkxgwtrlrgdvjwlzoypmehvxbfwjgzlpbzzpsfsadjzxkimh
        type: string
        custom: []
      visibility:
        name: visibility
        description: 'Must be at least 1. Must not be greater than 4.'
        required: false
        example: 0
        type: integer
        custom: []
      game_id:
        name: game_id
        description: 'Must be at least 1.'
        required: false
        example: 1
        type: integer
        custom: []
      category_id:
        name: category_id
        description: 'Must be at least 1.'
        required: false
        example: 1
        type: integer
        custom: []
      thumbnail_id:
        name: thumbnail_id
        description: 'Must be at least 1.'
        required: false
        example: 1
        type: integer
        custom: []
      tag_ids:
        name: tag_ids
        description: 'Must be at least 1.'
        required: false
        example:
          - 0
        type: 'integer[]'
        custom: []
      download_id:
        name: download_id
        description: 'Must be at least 1.'
        required: false
        example: 0
        type: integer
        custom: []
      download_type:
        name: download_type
        description: 'Must be one of <code>file</code> or <code>link</code>.'
        required: false
        example: file
        type: string
        custom: []
    responses: []
    responseFields: []
  -
    httpMethods:
      - GET
    uri: mods
    metadata:
      title: Mods
      description: 'Returns many mods, has a few options for searching the right mods'
      authenticated: false
      custom: []
    headers:
      Content-Type: application/json
      Accept: application/json
    urlParameters: []
    queryParameters:
      game_id:
        name: game_id
        description: 'How many mods should this return. Must be at least 1.'
        required: false
        example: 1
        type: integer
        custom: []
      tags:
        name: tags
        description: 'Must be at least 1.'
        required: false
        example:
          - 0
        type: 'integer[]'
        custom: []
      categories:
        name: categories
        description: 'Must be at least 1.'
        required: false
        example:
          - 1
        type: 'integer[]'
        custom: []
      block_tags:
        name: block_tags
        description: 'Filter out mods that are in these tags. Must be at least 1.'
        required: false
        example:
          - 0
        type: 'integer[]'
        custom: []
      submitter_id:
        name: submitter_id
        description: 'Must be at least 1.'
        required: false
        example: 0
        type: integer
        custom: []
      sort_by:
        name: sort_by
        description: ''
        required: false
        example: null
        type: string
        custom: []
    bodyParameters:
      query:
        name: query
        description: ''
        required: false
        example: dolorem
        type: string
        custom: []
      limit:
        name: limit
        description: 'Must be at least 1. Must not be greater than 1000.'
        required: false
        example: 6
        type: integer
        custom: []
